import {Box, TextField} from "@mui/material";
import {useState} from "react";

function Login() {
    const [email, setEmail] = useState('');

    return (
        <Box component="form" sx={{ display: 'flex', flexDirection: 'column', gap: 2, width: 300 }}>
            <TextField
                label="Email"
                value={email}
            />
            <TextField
            label="Password"/>
        </Box>
    );
}

export default Login;
